import React from 'react';
import styled from 'styled-components';
import Button from '@material-ui/core/Button';
import Home from './Icons';

const Nav = styled.div`
    width: 100vw;
    height: 40px;
    background: white;
    border-bottom: 2px solid #707070;
    position: absolute;
    margin-top: 0;
    display: flex;
    align-items: center;
`;

const Navbar = () => {
    return (
        <Nav>
            <Home />
            hi hello
        </Nav>
    );
};

export default Navbar;
